import React from "react";
import { Button, Col, Form, Row } from "react-bootstrap";

const Todolist = () => {
  return (
    <div>
      <Form>
        <Form.Label style={{ fontSize: "2rem", fontWeight: "lighter" }}>
          Task Master
        </Form.Label>
        <Row>
          <Col xs={9}>
            <Form.Control type="text" placeholder="Add Task" />
          </Col>
          <Col>
            <Button variant="dark" value="Add" type="submit">
              Add
            </Button>
          </Col>
        </Row>
      </Form>
    </div>
  );
};

export default Todolist;
